import React from "react";

const App = () => {
  let num = 1;

  const Increase = () => {
    console.log("clicked");
  };

  return (
    <>
      <div style={{ textAlign: "center" }}>
        <h1>Increment Decrement Challenge</h1>
        <h1>{num}</h1>
        <button onClick={Increase}>+</button>
        <button>-</button>
      </div>
    </>
  );
};

export default App;
